&lt;p&gt;&lt;strong&gt;Descripci&oacute;n:&nbsp;&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;La Caja de Diversi&oacute;n &ldquo;Todo en Uno&rdquo; LEGO&reg; DUPLO&reg; contiene un amplio surtido de ladrillos DUPLO con los que construir, reconstruir y disfrutar del juego creativo. El principal elemento es una base con ruedas para construir, con bordes redondeados y ruedas que giran de verdad. Este gran set incluye tambi&eacute;n 2 ventanas abatibles, un simp&aacute;tico perro y ladrillos numerados emparejados con ladrillos decorados para ayudar a tu hijo a aprender a contar. Incluso contiene ladrillos DUPLO cl&aacute;sicos para que ladiversi&oacute;n no tenga fin. Incluye una figura DUPLO de un chico.&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;Tema: Duplo&lt;/li&gt;
&lt;li&gt;Incluye una figura LEGO&reg; DUPLO&reg; de un chico.&lt;/li&gt;
&lt;li&gt;Contiene una base con ruedas, 2 elementos con forma de ventanas, un perro, ladrillos numerados y un amplio surtido de ladrillos DUPLO diferentes.&lt;/li&gt;
&lt;li&gt;Empareja los ladrillos numerados con los ladrillos decorados correspondientes.&lt;/li&gt;
&lt;li&gt;Almacena los ladrillos en la llamativa caja de almacenamiento con forma de ladrillo LEGO.&lt;/li&gt;
&lt;li&gt;Los productos LEGO&reg; DUPLO&reg; son divertidos y seguros para los m&aacute;s peque&ntilde;os.&lt;/li&gt;
&lt;li&gt;La casa mide m&aacute;s de 14 cm de altura, 12 cm de ancho y 8 cm de profundidad.&lt;/li&gt;
&lt;li&gt;La base con ruedas mide m&aacute;s de 5 cm de altura, 9 cm de longitud y 6 cm de ancho.&lt;/li&gt;
&lt;li&gt;El perro mide m&aacute;s de 4 cm de altura.&lt;/li&gt;
&lt;li&gt;El chico mide m&aacute;s de 5 cm de altura.&lt;/li&gt;
&lt;li&gt;Edad: 1&frac12; - 5&lt;/li&gt;
&lt;li&gt;Piezas: 65&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;&nbsp;&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;T&eacute;rminos y condiciones:&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;* Tienda Oficial de LEGO&reg;.&lt;/p&gt;
&lt;p&gt;* Garant&iacute;a: Sujetas a la marca.&lt;/p&gt;
&lt;p&gt;* Tiempo de entrega: De 6 a 10 d&iacute;as habiles a partir de la aprobaci&oacute;n del pago.&lt;/p&gt;
&lt;p&gt;* Valido hasta agotar existencias.&lt;/p&gt;
&lt;p&gt;* Unidades limitadas.&lt;/p&gt;
&lt;p&gt;* Precios sujetos a cambios sin previo aviso.&lt;/p&gt;

